import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

function Tagresult(props){
    const location = useLocation();
    const { reco } = location.state;    
    // const [reco, setReco] = useState([]);
    // const data = [
    //     {
    //     'songName' : 'a',
    //     'artistName' : 'a',
    //     'url' : 'https://i.scdn.co/image/ab67616d0000b2734ed058b71650a6ca2c04adff',
    //     },
    //     {
    //         'songName' : 'b',
    //         'artistName' : 'b',
    //         'url' : 'https://i.scdn.co/image/ab67616d0000b273b94bb18d775fd6d0127d1ee2',
    //     },        
    //     {
    //         'songName' : 'c',
    //         'artistName' : 'c',
    //         'url' : 'https://i.scdn.co/image/d38e330c69ce1695d5c2a7487169b0d4fa48dd93',
    //     },        
    //     {
    //         'songName' : 'd',
    //         'artistName' : 'd',
    //     },        
    //     {
    //         'songName' : 'e',
    //         'artistName' : 'e',
    //     },                                
    // ]
    const [selectedSongs, setSelectedSongs] = useState(new Set()); // 선택된 아이템 집합    
    const [selectedIds, setSelectedIds] = useState(new Set());    
    const userId = JSON.parse(localStorage.getItem('user')).id;    

    // const getResult = async() => {
    //     try {     
    //         const response = await axios.put(`http://localhost:8080/api/annoy/recommend-songs/${userId}`);
    //         setData(response.data);
    //         console.log(response);
    //     } catch (e) {
    //         console.log(e);
    //     }
    // };

    // useEffect(() => {
    //     getResult();
    //   }, []);

      const handleSongClick = (song) => {
        setSelectedSongs((prevSongs) => {
          const newSongs = new Set(prevSongs); // 이전 선택된 아이템 집합 복사
            newSongs.add(song);
          return newSongs;
        });
      };

      const handleIdClick = (song) => {
        setSelectedIds((prevIds) => {
          const newIds = new Set(prevIds); // 이전 선택된 아이템 집합 복사
            newIds.add(song);
          return newIds;
        });
      };          


  
    return (
      
        <div className="cent" style={{ margin: "20px", width: "100%" }}>
        <div style={{ display: "flex", justifyContent: "center" }}>
          <table className="td800">
            <tbody>
              <tr>
                <td colSpan="4" style={{ textAlign: "left" }}>
                  <p>당신이 좋아할만한 노래</p>
                </td>
              </tr>
              <tr style={{ fontSize : '16px', textAlign: 'left' }}>
              <td className="td400">
                <div style={{display : 'flex', flexDirection: 'row'}}>
                <img onClick={() => {handleSongClick(reco[0].songName); handleIdClick(reco[0].id);} }  alt = "song" src={reco[0].url} width="50" height="50"/>                         
                <div style = {{ marginLeft : '10px' }}>
                  <span onClick={() => {handleSongClick(reco[0].songName); handleIdClick(reco[0].id);}}>
                    {reco[0].songName}
                  </span>
                  <p onClick={() => {handleSongClick(reco[0].songName); handleIdClick(reco[0].id);}} style={{ fontSize: '10px', textAlign: 'left' }} >{reco[0].artistName}</p>                  
                </div>
                </div>                
              </td>
              </tr>
              <tr style={{ fontSize : '16px', textAlign: 'left' }} >
              <td className="td400">
                <div style={{display : 'flex', flexDirection: 'row'}} >
                  <img onClick={() => {handleSongClick(reco[1].songName); handleIdClick(reco[1].id);}} alt = "song" src={reco[1].url} width="50" height="50"/>                  
                  <div style = {{ marginLeft : '10px' }} >
                  <span onClick={() => {handleSongClick(reco[1].songName); handleIdClick(reco[1].id);}}>
                    {reco[1].songName}
                  </span>
                  <p onClick={() => {handleSongClick(reco[1].songName); handleIdClick(reco[1].id);}} style={{ fontSize: '10px', textAlign: 'left' }} >{reco[1].artistName}</p>
                </div>
                </div>
              </td>
              </tr>
              <tr style={{ fontSize : '16px', textAlign: 'left' }}>
              <td className="td400">
                <div style={{display : 'flex', flexDirection: 'row'}} >
                <img onClick={() => {handleSongClick(reco[2].songName); handleIdClick(reco[2].id);} }  alt = "song" src={reco[2].url} width="50" height="50"/>                         
                <div style = {{ marginLeft : '10px' }}>
                  <span onClick={() => {handleSongClick(reco[2].songName); handleIdClick(reco[2].id);}}>
                    {reco[2].songName}
                  </span>
                  <p onClick={() => {handleSongClick(reco[2].songName); handleIdClick(reco[2].id);}} style={{ fontSize: '10px', textAlign: 'left' }} >{reco[2].artistName}</p>                  
                </div>
                </div>                
              </td>
              </tr>
              <tr style={{ fontSize : '16px', textAlign: 'left' }} >
              <td className="td400">
                <div style={{display : 'flex', flexDirection: 'row'}} >
                  <img onClick={() => {handleSongClick(reco[3].songName); handleIdClick(reco[3].id);}} alt = "song" src={reco[3].url} width="50" height="50"/>                  
                  <div style = {{ marginLeft : '10px' }} >
                  <span onClick={() => {handleSongClick(reco[3].songName); handleIdClick(reco[3].id);}}>
                    {reco[3].songName}
                  </span>
                  <p onClick={() => {handleSongClick(reco[3].songName); handleIdClick(reco[3].id);}} style={{ fontSize: '10px', textAlign: 'left' }} >{reco[3].artistName}</p>
                </div>
                </div>
              </td>
              </tr>
              <tr style={{ fontSize : '16px', textAlign: 'left' }}>
              <td className="td400">
                <div style={{display : 'flex', flexDirection: 'row'}} >
                <img onClick={() => {handleSongClick(reco[4].songName); handleIdClick(reco[4].id);} }  alt = "song" src={reco[4].url} width="50" height="50"/>                         
                <div style = {{ marginLeft : '10px' }}>
                  <span onClick={() => {handleSongClick(reco[4].songName); handleIdClick(reco[0].id);}}>
                    {reco[4].songName}
                  </span>
                  <p onClick={() => {handleSongClick(reco[4].songName); handleIdClick(reco[4].id);}} style={{ fontSize: '10px', textAlign: 'left' }} >{reco[4].artistName}</p>                  
                </div>
                </div>                
              </td>
              </tr>
            </tbody>
          </table>
        </div>
    </div>

  
      
    );
  };
  
  export default Tagresult;
